import React from 'react';
import Button from 'react-bootstrap/Button'


function Purchase(){
    return (
        <div className="buttons">
            <Button variant="primary" size="lg" block>
                Buy 10 Shares
            </Button>
            <Button variant="secondary" size="lg" block>
                Sell 10 Shares
            </Button>
        </div>
    );

}

export default Purchase;
